def count_middle_points(n, points):
    cords = [[False] * 2001 for _ in range(2001)]
    for (x, y) in points:
        cords[x + 1000][y + 1000] = True
    count = 1
    for i in range(n):
        for j in range(i + 1, n):
            (x1, y1) = points[i]
            (x3, y3) = points[j]
            x2 = (x1 + x3) // 2
            y2 = (y1 + y3) // 2
            if (x1 + x3) % 2 == 0 and (y1 + y3) % 2 == 0 and cords[x2 + 1000][y2 + 1000]:
                count += 1
    return count

